import React from 'react';
import {
  Box,
  Typography,
  TextField,
  IconButton,
  InputAdornment,
  Button,
  LinearProgress,
  Snackbar,
  Alert
} from '@mui/material';
import VisibilityIcon from '@mui/icons-material/Visibility';
import VisibilityOffIcon from '@mui/icons-material/VisibilityOff';

export default function UserPasswordForm({ modo = 'registro', onSuccess }) {
  const [mostrarClave, setMostrarClave] = React.useState(false);
  const [mostrarConfirmar, setMostrarConfirmar] = React.useState(false);
  const [formData, setFormData] = React.useState({
    clave: '',
    confirmar: ''
  });
  const [errores, setErrores] = React.useState({});
  const [exito, setExito] = React.useState(false);

  const evaluarFortaleza = (clave) => {
    if (clave.length >= 10 && /[A-Z]/.test(clave) && /\d/.test(clave)) return 100;
    if (clave.length >= 8 && /\d/.test(clave)) return 60;
    if (clave.length >= 6) return 30;
    return 10;
  };

  const validar = () => {
    const newErrors = {};
    if (!formData.clave || formData.clave.length < 6) newErrors.clave = 'Mínimo 6 caracteres.';
    if (formData.confirmar !== formData.clave) newErrors.confirmar = 'No coinciden.';
    setErrores(newErrors);
    return Object.keys(newErrors).length === 0;
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    if (validar()) {
      console.log(`${modo === 'registro' ? 'Registrando' : 'Actualizando'} clave:`, formData.clave);
      setExito(true);
      if (onSuccess) onSuccess();
    }
  };

  return (
    <Box component="form" onSubmit={handleSubmit} noValidate sx={{ display: 'flex', flexDirection: 'column', gap: 2, p: 2 }}>
      <Typography variant="h6" sx={{ fontWeight: 'bold' }}>
        {modo === 'registro' ? 'Establecer Contraseña' : 'Modificar Contraseña'}
      </Typography>

      <TextField
        label="Contraseña"
        name="clave"
        type={mostrarClave ? 'text' : 'password'}
        fullWidth
        value={formData.clave}
        onChange={(e) => setFormData({ ...formData, clave: e.target.value })}
        error={!!errores.clave}
        helperText={errores.clave || 'Mínimo 6 caracteres, ideal con números y mayúsculas'}
        InputProps={{
          endAdornment: (
            <InputAdornment position="end">
              <IconButton onClick={() => setMostrarClave(!mostrarClave)} edge="end">
                {mostrarClave ? <VisibilityOffIcon /> : <VisibilityIcon />}
              </IconButton>
            </InputAdornment>
          )
        }}
      />

      <LinearProgress
        variant="determinate"
        value={evaluarFortaleza(formData.clave)}
        sx={{ height: 8, borderRadius: 5 }}
      />

      <TextField
        label="Confirmar Contraseña"
        name="confirmar"
        type={mostrarConfirmar ? 'text' : 'password'}
        fullWidth
        value={formData.confirmar}
        onChange={(e) => setFormData({ ...formData, confirmar: e.target.value })}
        error={!!errores.confirmar}
        helperText={errores.confirmar}
        InputProps={{
          endAdornment: (
            <InputAdornment position="end">
              <IconButton onClick={() => setMostrarConfirmar(!mostrarConfirmar)} edge="end">
                {mostrarConfirmar ? <VisibilityOffIcon /> : <VisibilityIcon />}
              </IconButton>
            </InputAdornment>
          )
        }}
      />

      <Button type="submit" variant="contained" color="primary" fullWidth sx={{ fontWeight: 'bold' }}>
        {modo === 'registro' ? 'Crear contraseña' : 'Actualizar'}
      </Button>

      <Snackbar
        open={exito}
        autoHideDuration={4000}
        onClose={() => setExito(false)}
        anchorOrigin={{ vertical: 'top', horizontal: 'center' }}
      >
        <Alert severity="success" variant="filled" onClose={() => setExito(false)}>
          {modo === 'registro' ? 'Contraseña creada' : 'Contraseña actualizada'} correctamente.
        </Alert>
      </Snackbar>
    </Box>
  );
}
